import './App.css';
import TopMenu from './layout/TopMenu';
import Home from './components/pages/Home'
import {
  Routes,
  Route,
  Link,
  BrowserRouter
} from "react-router-dom";


function App() {
  return ( <
    div className = "App" >
    <
    TopMenu > < /TopMenu> <
    BrowserRouter >
    <
    Routes >
    <
    Route path = "/"
    element = {
      Home
    } > < /Route> <
    /Routes> <
    /BrowserRouter> <
    /div>
  );
}

export default App;
